import { createContext, useState, useCallback } from 'react';
import axios from 'axios';

const ProjectsContext = createContext();

function PProvider({ children }) {
    const [projects, setProjects] = useState([]);

    //projects
    const fetchProjects = useCallback(async () => {
        //const response = await axios.get(`${process.env.REACT_APP_SERVER_URL}/projects`);
        const response = { data: [
            {
                id: 1,
                title: 'Todo List Creator',
                description: 'Convert and format classwork data to txt for download. This was one of my first independent projects, and has gone through 2 major refactors since its birth in 2022. It helped me to prioritize and plan my classwork throughout college. ',
                link: {
                    github: 'https://github.com/charleseMuchmore/todoListCreator.github.io',
                    online: 'https://charlesemuchmore.github.io/todoListCreator.github.io/'
                },
                image: 'data:image/jpeg;base64,'
            },
            {
                id: 2,
                title: 'Food Search',
                description: 'A simple interface for the Edamam Food API. This project allows for a search of the Edamam database for various food items.',
                link: {
                    github: 'https://github.com/charleseMuchmore/FoodSearch',
                    online: 'https://citstudent.lanecc.edu/~muchmorec323/web/FoodSearch/index.html'
                },
                image: 'data:image/jpeg;base64,'
            },
            {
                id: 3,
                title: 'Snake Game',
                description: 'A single player snake game. When the game loads in, the player can use the arrows on their keypad to control a "snake" on the screen. The goal is for the user to make the snake eat food and grow.',
                link: {
                    github: 'https://github.com/charleseMuchmore/SnakeGame',
                    online: '#'
                },
                image: 'data:image/jpeg;base64,'
            }
        ]}
        setProjects(response.data);
    }, []);

    //image placeholder: https://via.placeholder.com/300x200

    const deleteProjectById = async (id) => { 
        await axios.delete(`${process.env.REACT_APP_SERVER_URL}/projects/${id}`); 
        const updatedProjects = projects.filter((project) => { 
            return project.id !== id; }); 
            setProjects(updatedProjects); 
        };

    const editProjectById = async (id, props) => {
        const response = await axios.put(`${process.env.REACT_APP_SERVER_URL}/projects/${id}`, {
            title: props.title,
            userId: props.id, 
            description: props.description, 
            image: props.image, 
            link: props.link
        });

        const updatedProjects = [
            ...projects,
            response.data
        ];
        setProjects(updatedProjects);
    };

    const createProject = async (projectProps) => {
        const response = await axios.post(`${process.env.REACT_APP_SERVER_URL}/projects?`, projectProps);
        
        const updatedProjects = [
            ...projects,
            response.data
        ];
        setProjects(updatedProjects);
    };

    const valueToShare = {
        projects,
        fetchProjects,
        deleteProjectById,
        editProjectById,
        createProject
    };

   
    return <ProjectsContext.Provider value={valueToShare}>
        {children}
    </ProjectsContext.Provider>
}

export { PProvider };
export default ProjectsContext;